          "nb" : "ISTQB sidestiller metode med det engelske begrepet test approach, og omfatter implementeringen av teststrategien for et prosjekt. Dette inkluderer beslutningene som tas basert på testprosjektets mål og risikovurdering, starttidspunktet for testprosessen, testdesignteknikkene som skal brukes, sluttkriterier og testtyper som skal anvendes.\n\nTypiske metoder:\n•Analytiske metoder, som risikobasert testing der testing blir rettet mot områdene med størst risiko.\n•Modellbaserte metoder, som for eksempel tilfeldig stikkprøvetesting ved bruk av statistisk informasjon om feilrater (som pålitelighetsmodeller) eller bruk (som bruksprofiler). \n•Metodiske metoder, som feilbasert (inkludert feilgjetting og angrep basert på feil), erfaringsbasert, sjekklistebasert og kvalitetsegenskapsbasert. \n•Prosess- eller standardkonforme metoder, som de som er spesifisert i bransjestandarder."
