        "text" : {
          "nb" : "verdsettingsrabatt for for andel i norskkontrollert utenlandske selskap mv (NOKUS) i lavskatteland er en rabatt som trekkes fra før en fastsetter en gitt formuesverdi. Verdsettingsrabatten reduserer grunnlaget for formuesskatt og gir lavere formuesskatt om du har en netto formue som overstiger minstebeløpene for formuesskatt."
        },
        "remark" : {
          "nb" : "Med lavskatteland menes det i denne sammenheng stater med et skattenivå som er lavere enn to tredjedeler av det skattenivå som gjelder for tilsvarende selskaper i Norge. Det er i forskrift til skatteloven § 10-63 (FSSKD § 10-63-2 ) gjort en opplisting av land som skal anses som lavskatteland i forhold til skattereglene for utbytte, gevinst og tap på aksjer mv. Denne er bindende for NOKUS-formål uten nærmere vurdering av det faktiske skattenivået. Dersom du har gjeld, vil fradraget for gjeld bli redusert forholdsmessig mellom verdien av eiendeler med verdsettingsrabatt og verdien av din samlede formue. Har du ektefelle, registrert partner eller meldepliktig samboer vil gjeldsfradraget bli redusert på grunnlag av begges samlede eiendeler og gjeld."
        },
