          "nb" : "Påløpte renter trenger ikke nødvendigvis å ha forfalt til betaling ennå.\nI følgende tilfeller må rentene også være betalt for å gi inntektsfradrag:\nForsinkelsesrenter, misligholdte renter eller renter til Statens Lånkekass for Utdanning.\nDette gjelder likevel ikke dersom skyldneren har bokføringsplikt og har ført de påløpte rentene i skattleggingsperioden i regnskapet sitt.\n\nVed kredittkjøp av løsøre begrenser FSFIN §§ 6-40-3 og 6-40-4 hvor mye renter en kan fradra i grunnlaget for inntektsskatt. Overstiger rentene forskriftens maksimalgrenser tar en bare hensyn til det begrensede rentebeløpet når en fastsetter samlede påløpte renter.\n\nSamlede påløpte renter fastsettes før begrensning i fradragsretten etter skatteloven §§ 6-40 fjerde ledd, 6-41 og 6-91."
