      "definition" : {
        "text" : {
          "nb" : "en kategori som beskriver behovet til brukere som vil komme i arbeid ved egeninnsats og kan omfatte aktiviteter og tjenester av kortere varighet."
        },
        "remark" : {
          "nb" : "\"Situasjonsbestemt innsats tilbys brukere som har vansker med å skaffe seg eller beholde arbeid. Ofte vil dette behovet ha sammenheng med endringer i arbeidsmarkedet eller en mismatch mellom den enkeltes kvalifikasjoner og arbeidslivets krav. ...] Det må forventes at behovet for situasjonsbestemt innsats vil øke når ledigheten er høy. I tillegg til brukerens egeninnsats innebærer dette utfallet en innsats fra NAV som kan omfatte aktiviteter og tjenester av kortere varighet som kvalifisering og jobbsøking, foruten de generelle tjenestene. Brukeren har rett til å delta i utformingen av en aktivitetsplan.\""
        },
        "source" : {
          "prefLabel" : {
            "nb" : "\"Situasjonsbestemt innsats\". I: Retningslinjer for oppfølgingsvedtak i NAV s. 5. Hentet 26. april 2016 fra https://navet.adeo.no/ansatt/Fag/Arbeid+og+aktivitet/Relatert+innhold/retningslinjer-14a; \nLOV-2006-06-16-20 Lov om arbeids- og velferdsforvaltningen (arbeids- og velferdsforvaltningsloven) NAV-loven] § 14a"
          }
        },
        "sources" : [ {
          "text" : {
            "nb" : "\"Situasjonsbestemt innsats\". I: Retningslinjer for oppfølgingsvedtak i NAV s. 5. Hentet 26. april 2016 fra https://navet.adeo.no/ansatt/Fag/Arbeid+og+aktivitet/Relatert+innhold/retningslinjer-14a; \nLOV-2006-06-16-20 Lov om arbeids- og velferdsforvaltningen (arbeids- og velferdsforvaltningsloven) NAV-loven] § 14a"
          }
        } ]
      },
      "prefLabel" : {
        "nb" : "Situasjonsbestemt innsats SPES"
      },
      "altLabel" : [ ],
      "hiddenLabel" : [ {
        "nb" : "Moderat bistand"
      } ],
      "example" : {
        "nb" : "Situasjonsbestemt innsats tilbys eksempelvis når \n* bruker ikke har fullført videregående opplæring, \"fullført grunnopplæring anses som minimum for omstillingsevne og varig tilknytning til et arbeidsliv som i stigende grad etterspør utdannet arbeidskraft fremfor ufaglært.\" \n* det oppstår \"språkproblemer, der eksempelvis fremmedspråklige som ikke møter de kravene som stilles til å beherske norsk i arbeidslivet.\""
