      "definition" : {
        "text" : {
          "nb" : "samordnet talloppstilling for en gitt skattleggingsperiode og en gitt skattepliktig, NOKUS eller selskap med deltakerfastsetting knyttet til særskilte inntektsskattebestemmelser for å tidfeste når vedkommende som skal føre inntekt av negativ saldo i saldogruppe b og inntekt eller inntektsfradrag av realisert skattemessig gevinst eller tap på eiendeler i saldogruppe e, f, g, h, og i og noen andre eiendeler som har vært driftsmidler i virksomhet"
        },
        "remark" : {
          "nb" : "Den skattepliktige skal føre gevinst- og tapskonto særskilt for hver virksomhet og for hver kommune som hun/han er skattepliktig til, og som skal tilordnes gevinst eller tap undergitt stedbunden skattlegging. En kan ikke føre gevinster og tap på finansielle eiendeler som aksjer, verdipapirer mv. på gevinst- og tapskonto. Derimot skal gevinst- og tapskontoen tillegges skattemessig realisert gevinst på følgende eiendeler i virksomhet med mindre gevinsten er inntektsført direkte i realisasjonsåret: særskilte driftsmidler i kraftverk som kan avskrives lineært; driftsmidler i vindkraftverk som avskrives lineært; ikke-avskrivbare driftsmidler med unntak av aksjer, verdipapirer mv.; driftsmidler som avskrives lineært skattemessig; driftsmidler som avskrives skjønnsmessig skattemessig; driftsmidler som er kostnadsført direkte i ervervsåret. Eventuelt tap på slike driftsmidler i virksomhet skal en alltid fradra saldoen på gevinst- og tapskontoen."
        },
